import './vendors/bootstrap/css/bootstrap.min.css';
import './vendors/bootstrap/bootstrap.min.css';
import './vendors/fontawesome/css/all.min.css';

import './App.css';

function App() {
    return (
        <div className="container">
            <h1>Hello World!</h1>
        </div>
    );
}

export default App;

